import React from 'react';
import {getUsers} from "../data/data";


import './app.css';

class App extends React.Component{
    state ={
        users: []
    }
    render() {
        const {users} = this.state;

        if (users.length === 0){
            return <p>No phones yet</p>
        }

        return(
            <div className='container'>
                <h1>Products</h1>
                {
                    users.map(el => (
                        <p>
                            {
                                el.firstName
                            }
                        </p>
                    ))
                }
            </div>
        )
    }
}
export default App;
